import React from 'react';
import { Container, Typography, Box, TextField, Button, MenuItem, Select, InputLabel, FormControl } from '@mui/material';
import { LocalizationProvider, DatePicker, TimePicker } from '@mui/x-date-pickers';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';

const TimerPage = () => {
    const [selectedDate, setSelectedDate] = React.useState(null);
    const [selectedTime, setSelectedTime] = React.useState(null);
    const [selectedPeriod, setSelectedPeriod] = React.useState({ hours: 0, minutes: 0 });

    const handleDateChange = (date) => {
      setSelectedDate(date);
    };

    const handleTimeChange = (time) => {
      setSelectedTime(time);
    };

    const handlePeriodChange = (event) => {
      setSelectedPeriod({
        ...selectedPeriod,
        [event.target.name]: event.target.value,
      });
    };

    const handleSubmit = () => {
      alert(`Selected Date: ${selectedDate ? selectedDate.format('YYYY-MM-DD') : 'No Date'}
            Selected Time: ${selectedTime ? selectedTime.format('HH:mm:ss') : 'No Time'}
            Selected Period: ${selectedPeriod.hours} hours ${selectedPeriod.minutes} minutes`);
    };

    return (
      <LocalizationProvider dateAdapter={AdapterDayjs}>
        <Box sx={{ position: 'relative', height: '100vh', padding: 2 }}>
          <Typography
            variant="h4"
            sx={{
              position: 'absolute',
              top: 20,
              left: '50%',
              transform: 'translateX(-50%)',
              zIndex: 1,
            }}
          >
            Timer Page
          </Typography>
          <Container sx={{ textAlign: 'center', marginTop: '60px' }}>
            <Box sx={{ marginBottom: 2 }}>
              <DatePicker
                label="Select Date"
                value={selectedDate}
                onChange={handleDateChange}
                renderInput={(params) => <TextField {...params} />}
              />
            </Box>
            <Box sx={{ marginBottom: 2 }}>
              <TimePicker
                label="Select Time"
                value={selectedTime}
                onChange={handleTimeChange}
                renderInput={(params) => <TextField {...params} />}
              />
            </Box>
            <Box sx={{ marginBottom: 2 }}>
              <FormControl fullWidth>
                <InputLabel id="select-period-label">Select Period</InputLabel>
                <Box sx={{ display: 'flex', gap: 2 }}>
                  <FormControl fullWidth>
                    <InputLabel id="select-hours-label">Hours</InputLabel>
                    <Select
                      labelId="select-hours-label"
                      id="select-hours"
                      name="hours"
                      value={selectedPeriod.hours}
                      onChange={handlePeriodChange}
                      renderValue={(value) => `${value} hours`}
                    >
                      {[...Array(24).keys()].map((hour) => (
                        <MenuItem key={hour} value={hour}>
                          {hour}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                  <FormControl fullWidth>
                    <InputLabel id="select-minutes-label">Minutes</InputLabel>
                    <Select
                      labelId="select-minutes-label"
                      id="select-minutes"
                      name="minutes"
                      value={selectedPeriod.minutes}
                      onChange={handlePeriodChange}
                      renderValue={(value) => `${value} minutes`}
                    >
                      {[...Array(60).keys()].map((minute) => (
                        <MenuItem key={minute} value={minute}>
                          {minute}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                </Box>
              </FormControl>
            </Box>
            <Button
              variant="contained"
              color="primary"
              onClick={handleSubmit}
              sx={{
                marginTop: 2,
                borderRadius: '50px',
                background: 'linear-gradient(45deg, #84a7b8 30%, #aec1ca 90%)',
                boxShadow: '0 6px 10px 4px rgba(110, 138, 152, .3)',
                '&:hover': {
                  background: 'linear-gradient(45deg, #aec1ca 30%, #84a7b8 90%)',
                },
              }}
            >
              Submit
            </Button>
          </Container>
        </Box>
      </LocalizationProvider>
    );
  };

  export default TimerPage;
